import styles from "./BigCompanyList.module.css";
import React, {
  useState,
  useEffect,
  useRef,
  useContext,
  FC,
  SetStateAction,
  Dispatch,
} from "react";
import peopleSVG from "../../images/people.svg";

const BigCompanyList = () => {
  return (
    <div className={styles.container}>
      <img src={peopleSVG} alt="" />
      <h2>Notable Satisfied Customers</h2>
      <div className={styles.gridList}></div>
    </div>
  );
};

export default BigCompanyList;
